        <div className="Info">
            <label>
                    <p>Name</p>
                    <input type="text" className="addressData" name="address" onChange={(event) =>{ }} autoComplete="off" required minLength="4" maxLength="90"></input>
            </label>
            <label>
                <p>Material Print Temperature</p>
                <input type="number" id="tentacles" name="tentacles"
                    min="40" max="90" onChange={event => {}}/>
            </label>
            <label>
                <p>Material Bed Temperature</p>
                <input type="number" id="tentacles" name="tentacles"
                    min="40" max="90" onChange={event => {}}/>
            </label><br/>
        </div>
    )
}
